Kepiting tapal kuda atau Blangkas adalah artropoda dari famili Limulidae dan ordo Xiphosura. Limulidae terdiri dari 4 genera, tiga genus masih hidup dan satu genus punah. Genus yang punah, Mesolimulus, hidup pada akhir Jurassic sekitar 150 hingga 145 juta tahun yang lalu dan terlihat hampir identik dengan Blangkas modern. Asal-usul ordo Xiphosura sendiri dapat ditelusuri kembali ke 445 juta tahun yang lalu. Fisiologi Blangkas telah berubah dalam periode waktu, namun eksoskeleton khas tiga bagian mereka tetap ada sejak pertengahan era Paleozoikum. Keberhasilan tubuh ini menunjukkan keberhasilannya. Spesies Blangkas Amerika diperkirakan berpisah dari tiga spesies Indo-Pasifik sekitar 135 juta tahun yang lalu.
